import TabHeader from "./tabHeader";

const users = [user1, user2];

const user1 = {
    name: 'Matheus',
    recipes: [
        {
            name:'recipe1',
            description: 'chicken and rice'
        }
    ]
}
const user2 = {
    name: 'Ana',
    recipes: [
        {
            name:'recipe1',
            description: 'scrambled eggs with tomato'
        }
    ]
}
const Home = () => {
    return(
        <div className="">
            <TabHeader 
                mainText='Início'
                subText='Veja as atualizações de quem você está seguindo'
            />
            <ul className="flex flex-col">
                {users.map((user, index) => {
                    <li key={index} className="grid grid-flow-col bg-white">
                        <div>
                            {user.name}
                        </div>
                        <div>
                            {user.recipes.name}
                        </div>
                    </li>
                })}

            </ul>
        </div>
    )
}



export default Home;
